import React from "react";

function SearchForm(){
    return (
        <Form>
            <Form.Group controlId="formBasicEmail">
                <Form.Label>Search</Form.Label>
                <Form.Control type="search" placeholder="Search" />
            </Form.Group>

            <Button variant="primary" type="submit">
                Submit
            </Button>
        </Form>
    )
}

export default SearchForm;
